import React,{createContext,useState} from "react";

const Provider = (props)=>{
    const [state,setState] = useState({});
    
    return(
        <div>
            <appContext.Provider value={[state,setState]}>
                {props.children}
            </appContext.Provider>
        </div>
    );
}

export default Provider;
export const appContext = createContext();
